pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import './policy/PolicyModel.sol';

contract Policy is PolicyModel {

    PolicyModelStruct private _policyModel;

    modifier isMutual(){
        bool result = false;

        for(uint256 i = 0; i < _policyModel.mutual.wallets.length; i++ )
        {
            if(_policyModel.mutual.wallets[i] == msg.sender)
            {
                result = true;
            }
        }

        require(result, 'Policy: must be mutual to call this function');
        _;
    }

    event PolicyStatusUpdated(
        string apolice,
        string status
    );

    constructor (
        PolicyModelStruct memory policyModel
    ) public
    {
        _policyModel = policyModel;
    }

     function updateStatusPolicy(
        string memory status
    ) public
        isMutual
    {

        _policyModel.policyInformation.apoliceStatus = status;

        emit PolicyStatusUpdated(
            _policyModel.policyInformation.apolice,
            status
        );
    }

    function consultPolicyCoverage(
    ) public
      view
        isMutual
      returns(
            string memory coveragePrizeAmount,
            string memory coverageFipePercentage,
            string memory coverageApp,
            string memory coverageGlasses,
            string memory coverageRcfMaterials,
            string memory coverageRcfBodily,
            string memory coverageReserveCar,
            string memory coverageFranchise,
            string[] memory coverageProductCoverage
      )
    {
        return(
            _policyModel.coverage.prizeAmount,
            _policyModel.coverage.fipePercentage,
            _policyModel.coverage.app,
            _policyModel.coverage.glasses,
            _policyModel.coverage.rcfMaterials,
            _policyModel.coverage.rcfBodily,
            _policyModel.coverage.reserveCar,
            _policyModel.coverage.franchise,
            _policyModel.coverage.productCoverage
        );
    }

    function consultDriver(
    ) public
      view
        isMutual
      returns(
            string memory nameComplete,
            uint256 dateOfBirth,
            string memory maritalStatus,
            string memory pocket,
            string memory cpfCnpj,
            string memory gender,
            string memory profession,
            string memory cnh,
            uint256 dateFirstCnh,
            string memory garage,
            string memory usesWork,
            string memory vehicleUse
      )
    {
        return(
            _policyModel.driverData.nameComplete,
            _policyModel.driverData.dateOfBirth,
            _policyModel.driverData.maritalStatus,
            _policyModel.driverData.pocket,
            _policyModel.driverData.cpfCnpj,
            _policyModel.driverData.gender,
            _policyModel.driverData.profession,
            _policyModel.driverData.cnh,
            _policyModel.driverData.dateFirstCnh,
            _policyModel.driverData.garage,
            _policyModel.driverData.usesWork,
            _policyModel.driverData.vehicleUse
        );
    }

    function consultPolicyHolder(
    ) public
      view
        isMutual
      returns(
            string memory nameComplete,
            uint256 dateOfBirth,
            string memory maritalStatus,
            string memory pocket,
            string memory cnpjCpf,
            string memory gender,
            string memory relationshipPolicyHolder
      )
    {
        return(
            _policyModel.policyHoldedrData.nameComplete,
            _policyModel.policyHoldedrData.dateOfBirth,
            _policyModel.policyHoldedrData.maritalStatus,
            _policyModel.policyHoldedrData.pocket,
            _policyModel.policyHoldedrData.cnpjCpf,
            _policyModel.policyHoldedrData.gender,
            _policyModel.policyHoldedrData.relationshipPolicyHolder
        );
    }

     function consultPolicyInformation(
    ) public
      view
        isMutual
      returns(
            string memory proposal,
            string memory apolice,
            uint256 startValidity,
            uint256 endValidity,
            string memory apoliceStatus
      )
    {
        return (
            _policyModel.policyInformation.proposal,
            _policyModel.policyInformation.apolice,
            _policyModel.policyInformation.startValidity,
            _policyModel.policyInformation.endValidity,
            _policyModel.policyInformation.apoliceStatus
        );
    }

    function consultPolicyMutual(
    ) public 
      view
        isMutual
      returns(
            address[] memory mutualWallets
      )
    {
        return (
            _policyModel.mutual.wallets
        );
    }

    function consultVehicle(
    ) public
      view
        isMutual
      returns(
            string memory typeParam,
            string memory marker,
            string memory model,
            string memory numerSlides,
            string memory yearManufacture,
            string memory yearModel,
            string memory fuel,
            string memory newVehicle,
            string memory color
      )
    {
        return (
            _policyModel.vehicleData.typeParam,
            _policyModel.vehicleData.marker,
            _policyModel.vehicleData.model,
            _policyModel.vehicleData.numerSlides,
            _policyModel.vehicleData.yearManufacture,
            _policyModel.vehicleData.yearModel,
            _policyModel.vehicleData.fuel,
            _policyModel.vehicleData.newVehicle,
            _policyModel.vehicleData.color
        );
    }

    function consultVehicleDocuments(
    ) public
      view
        isMutual
      returns(
            string memory licensePlate,
            string memory chassis,
            string memory renavam,
            string memory vehicleFinaced
      )
    {
        return(
            _policyModel.vehicleData.licensePlate,
            _policyModel.vehicleData.chassis,
            _policyModel.vehicleData.renavam,
            _policyModel.vehicleData.vehicleFinaced
        );
    }
}
